import React from "react";
import UploadWrapper from "../styled/uploadStyled/UploadWrapper";
import Uploader from "./Uploader";
import PostForm from "./PostForm";

const Upload = () => {
  return (
    <UploadWrapper>
      <PostForm>
        <Uploader />
      </PostForm>
      <PostForm>
        <Uploader />
      </PostForm>
      <PostForm>
        <Uploader />
      </PostForm>
      <PostForm>
        <Uploader />
      </PostForm>
    </UploadWrapper>
  );
};

export default Upload;
